// import NavSingle from "./NavSingle";
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope, faPhone } from '@fortawesome/free-solid-svg-icons'




function Footer() {
    return (
        <footer>
        <br></br>
            <ul>
                <div className="inner ToCenter">
                    <a href="tel:+91-9910584860" className="ToCenter FontAwesomeIcon SmFont NavBarText">
                        <FontAwesomeIcon icon={faFa} />
                    </a>
                    <a className="FontAwesomeIcon SmFont NavBarText" href='mailto:dt.rashumalhotra@gmail.com'>
                        <FontAwesomeIcon icon={faEnvelope} />
                    </a>
                </div>
                <p className="MidText LightGreenFontShade NonCursiveFont VySmFont">
                    @Copyright 2022
                </p>
            </ul>
        </footer>
    );
}

export default Footer;
